sourcesContent:
import express from 'express';
import RecipeService from "../services/recipe.service";

const recipeService = new RecipeService();

const getRecipe = async (req, res, next) => {
  /**
   * @typedef {Object} inputData
   * @property {string[]} foods - ìŒì‹ ìž¬ë£Œ ëª©ë¡
   */
  const { foods } = req.body;

  if (!foods || !Array.isArray(foods) || foods.length === 0) {
    return next(new Error("foods is required and should be a non-empty array"));
  }

  try {
    const recipeData = await recipeService.getRecipe(foods.join(', '));

    if (!recipeData) {
      res.status(404).send("GPT ë¬¸ì œìƒê¹€ ë‚˜ì¤‘ì— í•´ê²°ë°”ëžŒ");
    } else {
      res.status(200).json(recipeData);
    }
  } catch (error) {
    console.error("Error in getRecipe handler:", error);
    res.status(500).send("Internal Server Error");
  }
};

export default getRecipe;

