import userService from "../services/user.service";

const userLogin = async (req, res, next) => {
  /**
   * @userData {Object}
   * @property {string} username - ì‚¬ìš©ìž ë‹‰ë„¤ìž„
   * @property {string} password - ë¹„ë°€ë²ˆí˜¸
   */
  let { email, password } = req.body;
  let userData = await userService.signin(email, password);
  if (userData === "404") {
    res.status(404).send("User not found");
    return;
  } else {
    res.send(userData);
    return;
  }
};

const userSignup = async (req, res, next) => {
  /**
   * @userData {Object} - ì‚¬ìš©ìž ë°ì´í„°
   * @property {string} email - ì‚¬ìš©ìž ì•„ì´ë””
   * @property {string} username - ì‚¬ìš©ìž ë‹‰ë„¤ìž„
   * @property {string} password - ë¹„ë°€ë²ˆí˜¸
   */
  let { email, password, username } = req.body;
  // next(await loginService.signup(email, password, username));
  let result = await userService.signup(email, password, username);
  if (result === "404") {
    res.status(404).send("ë°ì´í„°ë¥¼ ì „ë¶€ ìž…ë ¥í•´ì£¼ì„¸ìš”");
    return;
  } else {
    res.send(result);
    return;
  }
};

const userProfile = async (req, res, next) => {
  /**
   * @userData {Object}
   * @property {string} user_id - ì‚¬ìš©ìž ì‹ë³„ìž
   */
  const user_id = req.params.userId;
  let userData = await userService.profile(user_id);

  if (userData === "404") {
    res.status(404).send("User not found");
    return;
  } else {
    res.send(userData);
    return;
  }
};

const putUserProfile = async (req, res, next) => {
  /**
   * @userData {Object}
   * @property {string} user_id - ì‚¬ìš©ìž ì‹ë³„ìž
   * @property {string} password - ë¹„ë°€ë²ˆí˜¸
   * @property {number} alert_date - ë¹„ë°€ë²ˆí˜¸
   */
  const user_id = req.params.userId;
  const { password, alert_date } = req.body;

  let userData = await userService.putUserProfile(
    user_id,
    password == "" ? null : password,
    alert_date
  );

  if (userData === "404") {
    res.status(404).send("User not found");
    return;
  } else {
    res.send(userData);
    return;
  }
};

export default {
  userLogin,
  userSignup,
  userProfile,
  putUserProfile,
};

