import dbConfig from "../configs/db.config";
import OpenAI from "openai";
import dotenv from "dotenv";

dotenv.config();

const OPENAI_API_KEY = process.env.OPENAI_API_KEY;
const OPENAI_ORGANIZATION_KEY = process.env.OPENAI_ORGANIZATION_KEY;
const OPENAI_PROJECT_KEY = process.env.OPENAI_PROJECT_KEY;

class FoodService {
  constructor(dbConfig) {
    this.dbConfig = dbConfig;
    this.openai = new OpenAI({
      apiKey: OPENAI_API_KEY,
      organization: OPENAI_ORGANIZATION_KEY,
      project: OPENAI_PROJECT_KEY,
    });
  }

  async postFoodTips(food_name) {
    const openAIMessages = {
      system: `ë„ˆëŠ” ì„¸ê³„ ìµœê³ ì˜ 'ì‹ìž¬ë£Œ' ì „ë¬¸ê°€ì•¼.
        ë‚˜ì—ê² '${food_name}'ì˜ ìž¬ë£Œê°€ ìžˆëŠ”ë°, ì´ ìž¬ë£Œì— ëŒ€í•œ ê¸°ë³¸ì ì¸ ì •ë³´ë“¤ì„ ì•Œë ¤ì¤˜.
        íŠ¹ížˆ ë³´ê´€ ë°©ë²•ê³¼ ìœ í†µê¸°í•œ, ê·¸ë¦¬ê³  ì´ ìž¬ë£Œë¥¼ ì‚¬ìš©í•œ ëŒ€í‘œ ë©”ë‰´ë“¤ì„ ì•Œë ¤ì¤˜.
        ë„¤ê°€ ëŒ€ë‹µì„ ì‹œìž‘í•  ë•Œ '${food_name}ì˜ ì •ë³´ë¥¼ ì•Œë ¤ë“œë¦¬ê² ìŠµë‹ˆë‹¤!'ë¼ê³  ë§í•´ì¤˜.`,
    };
    console.log("openAIMessages :", openAIMessages.system);

    try {
      const completion = await this.openai.chat.completions.create({
        messages: [{ role: "system", content: openAIMessages.system }],
        model: "gpt-4o",
        max_tokens: 1024,
        temperature: 1, // ì°½ì˜ì„±
      });
      console.log(completion.choices);
      return completion.choices[0].message.content;
    } catch (error) {
      console.error("Error fetching data from OpenAI API:", error);
      throw error;
    }
  }

  async getFoodDataAll(user_id, category = null, food_name = null) {
    const client = await this.dbConfig.connect();
    let query = "SELECT * FROM food_schema.food_data WHERE user_id = $1";
    let values = [user_id];

    if (category === "food_name") {
      query += ` AND food_name ILIKE $2`;
      values.push(`%${food_name}%`);
    } else if (category === "category") {
      query += ` AND category ILIKE $2`;
      values.push(`%${food_name}%`);
    } else if (category) {
      query += " AND category = $2";
      values.push(category);
    }

    try {
      const result = await client.query(query, values);
      console.log(`${user_id} ë‹˜ì˜ ìŒì‹ ë°ì´í„° : `, result.rows);
      return result.rows;
    } catch (error) {
      console.error("Error executing query", error);
      throw error;
    } finally {
      client.release();
    }
  }

  async getFoodData(user_id, food_id) {
    const client = await this.dbConfig.connect();
    const query =
      "SELECT * FROM food_schema.food_data WHERE user_id = $1 AND food_id = $2";
    const values = [user_id, food_id];

    try {
      const result = await client.query(query, values);
      console.log(`${user_id} ë‹˜ì˜ ${food_id}ë²ˆì˜ ìŒì‹ ë°ì´í„° : `, result.rows);
      return result.rows;
    } catch (error) {
      console.error("Error executing query", error);
      throw error;
    } finally {
      client.release();
    }
  }

  async postFoodData(
    user_id,
    food_name,
    food_pic,
    category,
    purchase_date,
    expiration_date,
    food_amount
  ) {
    const client = await this.dbConfig.connect();
    const query =
      "INSERT INTO food_schema.food_data (user_id, food_name, food_pic, category, purchase_date, expiration_date, food_amount) VALUES ($1, $2, $3, $4, $5, $6, $7) RETURNING *";
    const values = [
      user_id,
      food_name,
      food_pic,
      category,
      purchase_date,
      expiration_date,
      food_amount,
    ];

    try {
      const result = await client.query(query, values);
      console.log("food_schemaì— ë“±ë¡ë  ê°’ : ", result.rows);
      return result.rows[0];
    } catch (error) {
      console.error("Error saving food to database:", error);
      throw error;
    } finally {
      client.release();
    }
  }
  async deleteFoodData(user_id, food_id) {
    const client = await this.dbConfig.connect();
    const query =
      "DELETE FROM food_schema.food_data WHERE user_id = $1 AND food_id = $2";
    const values = [user_id, food_id];

    try {
      const result = await client.query(query, values);
      console.log(`${user_id} ë‹˜ì˜ ${food_id}ë²ˆ ìŒì‹ ë°ì´í„° ì‚­ì œ`);
      return result;
    } catch (error) {
      console.error("Error executing query", error);
      throw error;
    } finally {
      client.release();
    }
  }
  async putFoodData(
    user_id,
    food_id,
    food_amount,
    purchase_date,
    expiration_date
  ) {
    try {
      const client = await this.dbConfig.connect();
      const query =
        "UPDATE food_schema.food_data SET food_amount = $3, purchase_date = $4, expiration_date = $5 WHERE user_id = $1 AND food_id = $2 RETURNING *";
      const values = [
        user_id,
        food_id,
        food_amount,
        purchase_date,
        expiration_date,
      ];
      const result = await client.query(query, values);
      console.log("result", result);
      client.release();

      if (!result.rows[0]) {
        return "404";
      } else {
        return result.rows[0];
      }
    } catch (error) {
      console.error(`Error updating Food Data ${food_id}:`, error);
      throw error;
    }
  }
}

// FoodService ì¸ìŠ¤í„´ìŠ¤ ìƒì„± ë° export
const foodService = new FoodService(dbConfig);
export default foodService;

