import OpenAI from "openai";
import dotenv from "dotenv";

dotenv.config();

const OPENAI_API_KEY = process.env.OPENAI_API_KEY;
const OPENAI_ORGANIZATION_KEY = process.env.OPENAI_ORGANIZATION_KEY;
const OPENAI_PROJECT_KEY = process.env.OPENAI_PROJECT_KEY;

class RecipeService {
  constructor() {
    this.openai = new OpenAI({
      apiKey: OPENAI_API_KEY,
      organization: OPENAI_ORGANIZATION_KEY,
      project: OPENAI_PROJECT_KEY,
    });
  }

  async getRecipe(foodData) {
    const openAIMessages = {
      system: `ë„ˆëŠ” ì„¸ê³„ ìµœê³ ì˜ 'ìš”ë¦¬' ì „ë¬¸ê°€ì•¼.
        ë‚˜ì—ê² '${foodData}'ì˜ ìž¬ë£Œê°€ ìžˆëŠ”ë°, ì´ ìž¬ë£Œë¥¼ ëª¨ë‘ ì‚¬ìš©í•´ì„œ ì–´ë–¤ ìš”ë¦¬ë¥¼ ë§Œë“¤ ìˆ˜ ìžˆì„ê¹Œ?
        ì›¬ë§Œí•˜ë©´ í•œì‹ìœ¼ë¡œ ë¨¹ê³  ì‹¶ì€ë°, ì¶”ì²œí•˜ëŠ” ìš”ë¦¬ ì´ë¦„ 3ê°œë§Œ, ê·¸ ì¤‘ì—ì„œ ê°€ìž¥ ì¶”ì²œí•˜ëŠ” ìš”ë¦¬ì˜ ë ˆì‹œí”¼ëŠ” ìƒì„¸í•˜ê²Œ ì ì–´ì¤˜.
        ë„¤ê°€ ëŒ€ë‹µì„ ì‹œìž‘í•  ë•Œ 'ì œê°€ ì¶”ì²œí•˜ëŠ” ìš”ë¦¬ëŠ” 1. ë¬´ì—‡ 2. ë¬´ì—‡ 3. ë¬´ì—‡ ìž…ë‹ˆë‹¤. ê·¸ ì¤‘ì—ì„œ ê°€ìž¥ ì¶”ì²œí•˜ëŠ” ìš”ë¦¬ì˜ ë ˆì‹œí”¼ëŠ” ë‹¤ìŒê³¼ ê°™ìŠµë‹ˆë‹¤.'ë¼ê³  ë§í•´ì¤˜.`,
    };
    console.log("openAIMessages :", openAIMessages.system)

    try {
      const completion = await this.openai.chat.completions.create({
        messages: [{ role: "system", content: openAIMessages.system }],
        model: "gpt-4",
        max_tokens: 1024,
        temperature: 1, // ì°½ì˜ì„±
      });
      console.log(completion.choices);
      return completion.choices[0].message.content;
    } catch (error) {
      console.error("Error fetching data from OpenAI API:", error);
      throw error;
    }
  }
}

const recipeService = new RecipeService();

export default recipeService;

